Ne="Dodaj now aplikacj OAuth2",ONe={CLIENT_ID:"Identyfikator",CLIENT_SECRET:"Sekret",DESCRIPTION:"Opis aplikacji",ISSUE_AT:"Wydana",NAME:"Nazwa aplikacji",REDIRECT_URL:"Adres URL przekierowania",SCOPE:{LABEL:"Zakres","application:write_DESCRIPTION":"nadaje dostp do zapisu konfiguracji aplikacji.","equipments:read_DESCRIPTION":"nadaje dostp do odczytu z adresw <code>equipments</code>.","equipments:write_DESCRIPTION":"nadaje dostp do zapisu na adresach <code>equipments</code>.","profile:read_DESCRIPTION":"nadaje dostp do odczytu z adresw <code>auth</code>.","profile:write_DESCRIPTION":"nadaje dostp do zapisu na adresach <code>auth</code>.","users:read_DESCRIPTION":"nadaje dostp do odczytu z adresw <code>users</code>.","users:write_DESCRIPTION":"nadaje dostp do zapisu na adresach <code>users</code>.","workouts:read_DESCRIPTION":"nadaje dostp do odczytu z adresw <code>workouts</code>.","workouts:write_DESCRIPTION":"nadaje dostp do zapisu na adresach <code>workouts</code>."},URL:"Adres URL aplikacji"},gNe="Aplikacje OAuth2",INe="Aplikacja pomylnie utworzona. Upewnij si teraz, aby skopiowa sekret. On ju si wicej nie wywietli.",RNe="Czy na pewno chcesz usun t aplikacj?",NNe="Aplikacja {0} wnioskuje o:",vNe="Zezwoli {0} by uywaa twojego konta?",bNe="skopiuj do schowka",CNe="Usu aplikacj",DNe="Dodaj aplikacj",PNe="Aplikacja nie znaleziona!",yNe="brak aplikacji",LNe="bez opisu",$Ne="Odwoaj wszystkie tokeny",kNe="Czy na pewno odwoa wszystkie tokeny?",UNe="Wszystkie istniejce powizane tokeny zostay odwoane.",wNe={ADD_A_NEW_APP:ANe,APP:ONe,APPS_LIST:gNe,APP_CREATED_SUCCESSFULLY:INe,APP_DELETION_CONFIRMATION:RNe,APP_REQUESTING_ACCESS:NNe,AUTHORIZE_APP:vNe,COPY_TO_CLIPBOARD:bNe,DELETE_APP:CNe,NEW_APP:DNe,NO_APP:PNe,NO_APPS:yNe,NO_DESCRIPTION:LNe,REVOKE_ALL_TOKENS:$Ne,TOKENS_REVOCATION_CONFIRMATION:kNe,TOKENS_REVOKED:UNe},MNe={ACCOUNT_DELETION:{CONTENT:'Moesz zoy wniosek usunicia konta w kadej chwili poprzez wejcie na ten adres (po zalogowaniu) i kliknicie "Usu moje konto" na ekranie edycji konta.',TITLE:"Usuwanie konta"},CHANGES_TO_OUR_PRIVACY_POLICY:{CONTENT:`Jeli zdecydujemy si zmieni nasz polityk prywatnoci, umiecimy zmiany na tej stronie.

Ten dokument jest na licencji [CC-BY-SA](https://creativecommons.org/licenses/by-sa/4.0/). Oryginalnie zaczerpnity z polityki prywatnoci [Discourse](https://github.com/discourse/discourse).`,TITLE:"Zmiany w naszej polityce prywatnoci"},DATA_COLLECTED:{CONTENT:`Nastpujce dane s zbierane:
- Informacje o koncie (nazwa uytkownika, adres e-mail, haso). Dobrowolnie podane dane konta jak imi, nazwisko, data urodzenia, lokalizacja, informacje o sobie, czy zdjcie profilowe.
- Pliki [GPX](https://pl.wikipedia.org/wiki/GPX). Te pliki zawieraj dane zwizane z Twoimi aktywnociami (koordynaty geograficzne, daty, pokonane dystanse, ich czasy trwania, prdkoci, wysokoci miejsc, ttno). Jeli nie chcesz przekazywa czci z tych danych, usu je z plikw GPX przed ich wysaniem, albo dodawaj treningi bez plikw GPX.
- Dane o treningach (jaki sport, nazwy, daty, czasy trwania, pokonane dystanse, wzniesienia, spadki, dodane notatki).
- Informacje techniczne (uyta przegldarka internetowa i system operacyjny).`,TITLE:"Jakie informacje zbieramy?"},INFORMATION_DISCLOSURE:{CONTENT:`Nie sprzedajemy, nie handlujemy, ani w aden sposb nie przekazujemy na zewntrz twoich prywatnych danych, ktre by pozwoliy na twoj identyfikacj.

To nie dotyczy zaufanych partnerw, ktrzy pomagaj nam utrzymywa ten serwis i oferowa ci usugi, o ile zgodzili si oni utrzymywa te informacje w tajemnicy.

Moemy te udostpni twoje dane kiedy uznamy, e jest to stosowne, aby by zgodnym z prawem. Moemy to te zrobi w celu wymuszenia polityki naszej strony lub by chroni nasze/czyje prawa, wasno lub bezpieczestwo.

Jeli zezwolisz zewntrznej aplikacji, aby uywaa twojego konta, to zalenie od zakresu uprawnie, na jaki zezwolisz, moe ona uzyska dostp do informacji z twojego profilu lub do twoich treningw. Aplikacje nigdy nie maj dostpu do twojego hasa.`,TITLE:"Czy udostpniamy jakie informacje zewntrznym instytucjom?"},INFORMATION_PROTECTION:{CONTENT:"Stosujemy zestaw rodkw bezpieczestwa aby zachowa bezpieczestwo twoich prywatnych danych, kiedy je podajesz, wysyasz lub pobierasz.",TITLE:"Jak chronimy twoje dane?"},INFORMATION_USAGE:{CONTENT:`Dane, ktre zbieramy od ciebie mog zosta uyte by dostarczy ci kluczowych funkcjonalnoci **FitTrackee**:
- Pliki GPX s uywane by tworzy treningi, wywietla trasy na mapie (za pomoc [OpenStreetMap](https://www.openstreetmap.org) i skonfigurowanego serwera kafelkw z graficzn reprezentacj mapy), wywietla wykresy, generowa miniatury map, oblicza rekordy i pobiera dane pogodowe (jeli skonfigurowano dostawc danych pogodowych).
- Informacje z profilu oraz treningi nie s wywietlane publicznie. Zarejestrowany uytkownik moe wywietla tylko swoje wasne treningi.
- Adres e-mail, ktry podajesz, moe by uyty do wysyania ci informacji lub potwierdzenia zmian na koncie.`,TITLE:"Do czego uywamy twoich danych?"},SITE_USAGE_BY_CHILDREN:{CONTENT:`Jeli ten serwer znajduje si w Unii Europejskiej lub Europejskim Obszarze Gospodarczym: Nasza strona i usugi s przeznaczone dla ludzi w wieku co najmniej 16 lat. Jeli jeste poniej tego wieku, to wedug wymaga [GDPR](https://pl.wikipedia.org/wiki/Og%C3%B3lne_rozporz%C4%85dzenie_o_ochronie_danych) (Oglne rozporzdzenie o ochronie danych) nie uywaj tej strony.

Jeli ten serwer znajduje si w USA: Nasza strona, produkty i usugi s skierowane do ludzi w wieku co najmniej 13 lat. Jeli jeste poniej tego wieku, to wedug wymaga [COPPA](https://pl.wikipedia.org/wiki/Children%E2%80%99s_Online_Privacy_Protection_Act) (Children's Online Privacy Protection Act) nie uywaj tej strony.

Wymagania prawne mog by inne, jeli ten serwer znajduje si w innej jurysdykcji.`,TITLE:"Uywanie strony przez dzieci"},YOUR_CONSENT:{CONTENT:"Poprzez uywanie tej strony, wyraasz zgod na nasz polityk prywatnoci.",TITLE:"Twoja zgoda"}},FNe="Ostatnia aktualizacja",zNe="polityka prywatnoci",WNe={CONTENT:MNe,LAST_UPDATE:FNe,TITLE:zNe},xNe={LABEL:"Piesza wycieczka"},BNe={LABEL:"Alpinizm"},GNe={LABEL:"Paralotniarstwo"},HNe={LABEL:"Wiolarstwo"},VNe={LABEL:"Bieg"},jNe={LABEL:"Rakiety niene"},KNe={LABEL:"Szlak"},qNe={LABEL:"Chd"},YNe={"Cycling (Sport)":{LABEL:"Kolarstwo (Sport)"},"Cycling (Transport)":{LABEL:"Kolarstwo (Transport)"},"Cycling (Trekking)":{LABEL:"Kolarstwo (Trekking)"},"Cycling (Virtual)":{LABEL:"Kolarstwo (Wirtualne)"},Hiking:xNe,"Mountain Biking":{LABEL:"Kolarstwo grskie"},"Mountain Biking (Electric)":{LABEL:"Kolarstwo grskie (Elektryczne)"},Mountaineering:BNe,"Open Water Swimming":{LABEL:"Pywanie na wodach otwartych"},Paragliding:GNe,Rowing:HNe,Running:VNe,"Skiing (Alpine)":{LABEL:"Narciarstwo alpejskie"},"Skiing (Cross Country)":{LABEL:"Narciarstwo biegowe"},Snowshoes:jNe,Trail:KNe,Walking:qNe},XNe="Statystyki",QNe={month:"Miesiczne statystyki",week:"Tygodniowe statystyki",year:"Roczne statystyki"},ZNe={month:"miesic",week:"tydzie",year:"rok"},JNe={STATISTICS:XNe,STATISTICS_CHARTS:QNe,TIME_FRAMES:ZNe},eve="Potwierdzenie konta",tve="Nie otrzymae(-a) instrukcji?",nve="Sprawd swj e-mail. Nowa wiadomo z potwierdzeniem zostaa wysana na podany adres.",ave="Administrator",sve="Masz ju konto?",rve="Czy jeste pewien, e chcesz usun swoje konto? Wszystkie dane zostan nieodwracalnie skasowane.",ove="Aktualne haso",ive="E-mail",uve="Podaj poprawny adres e-mail.",lve="Aktualizacja adresu e-mail",cve="Podaj haso",dve={DATA_EXPORT:"Eksport danych",DOWNLOAD_ARCHIVE:"Pobierz archiwum",GENERATING_LINK:"generowanie linka",ONLY_ONE_EXPORT_PER_DAY:"Moesz poprosi o archiwum w przecigu 24 godzin",STATUS:{errored:"niepowodzenie (prosz zleci kolejny eksport)",in_progress:"w trakcie"}}